    [],nt"revision_timestamp": "2016-02-27T17:19:06.979419",nt"name": "social-security-number-verification-service-ssnvs",nt"isopen":
    true,nt"url": null,nt"notes": "SSNVS is a service offered by SSA's Business
    Services Online (BSO). It is used by employers and certain third-party submitters
    to verify the accuracy of the names and SSNs of their employees for wage reporting
    purposes. With SSNVS users may verify up to 10 names and SSNs online for immediate
    results or upload batch files for overnight processing. SSNVS uses the Numident
    Online Verification Utility (NOVU) for the online requests and EVS for the batch
    requests. SSNVS is maintained by OSES and both NOVU and EVS are maintained in OEEAS
    DIVES Verification System Branch.",nt"license_title": "Other License Specified",nt"extras":
